"text":"","user_id":100,"has_tags":false}}],"post_source":{"type":"vk"},"comments":{"can_post":1,"count":1},"likes":{"can_like":1,"count":396,"user_likes":0,"can_publish":1},"reposts":{"count":62,"user_reposted":0},"views":{"count":12329},"donut":{"is_donut":false},"short_text_rate":0.8,"carousel_offset":0,"post_id":692110,"type":"post"},{"source_id":-42800749,"date":1661219700,"is_favorite":false,"post_type":"post","text":"Срочно разыскиваю 2 заполнительниц карточек. Зп - 14 тысяч в неделю получаю тут я с первого месяца. Опыт не нужен, все покажу, там быстро.nnУсловия: график на выбор. Можно от одного часа в день даже.nnВас ждет:nn1. Удаленная занятость.n2. Гибкий график.nnНужно простые карточки заполнять. Опыт не требуется. Можно по часу и 2 часа работать, пока сидите дома с ребенком. Работы много из-за ухода западных фирм и роста отечественных.nnТребование одно - наличие компьютера и готовность к удаленной работе. Смотрите.nn14 тысяч в неделю, если умножить на 4, выходит 56 тысяч в месяц - средние стабильные деньги за неполный день, которые я получала от предпринимателей начав с нуля. Через год получала уже 100 тысяч. Да, для кого-то это немного.nnНо если всю жизнь работать за 30-40 тысяч - это очень хорошая зарплата. Особенно, когда ты экономишь 2 часа своей жизни и деньги на дорогу. Ты свободна в передвижении, ведь все удаленно.nnПорой так тянет на улицу, на солнышко, но ты выходишь с работы в 5-6 вечера, и ты хочешь спать. От тебя навсегда закрыто 90% твоей же жизни. А на этой работе - всем все равно, где ты находишься. Можешь взять ноутбук и родителей навестить, на море съездить, как все уляжется со всей этой ситуацией. Я через через пару месяцев работы могла позволить себе семью свозить на море. Денег хватает.nnА чтобы начать работать прямо сейчас - нужно две вещи, и одну ты уже делаешь.nnЧитаешь этот текст.nnВторое, желание освоить выполнение рутинной, не очень сложной работы. Помогая предпринимателям вести аккаунты их магазинов на Wildberries. Например, такому предпринимателю как я.nnПрофессия называется - менеджер Wildberries.nnСейчас сложное время, но у меня бизнес независимый от Запада, мы помогаем предпринимателям в выходе на Wildberries, в ведении и масштабировании бизнеса, потому я просто выстрелила из-за ухода конкурентов западных и роста числа отечественных предпринимателей и мне нужна ваша помощь.nnВсем стало остро не хватать менеджеров Wildberries, в том числе и мне.nnЧто нужно, чтобы получить возможность стать менеджером Wildberries?nnПосмотреть мою пошаговую инструкцию, в которой я рассказываю про то, что конкретно нужно делать, сколько за это можно получать, как работать и тд.nnИнструкцию я отдаю по ссылке ниже. То есть проходите бесплатную регистрацию, нажимая на ссылку ниже, потом жмете кнопку \"Разрешить\", а дальше я пришлю вам что делать.nnВот ссылка:nnhttps://vk.com/app5898182_-206693391#u=1506051&s=1775005&force=1&utm_campaign=market2908&utm_source=malah&utm_term=vd1&utm_content=214_5_sroz_mp_inst_LOnnВозьму еще не больше 5 человек.","marked_as_ads":1,"attachments":[{"type":"photo","photo":{"album_id":-51,"date":1661159470,"id":457741050,"owner_id":-42800749,"access_key":"2716a27d53379a2cd1","post_id":788379,"sizes":[{"height":75,"url":"https://sun1-15.userapi.com/impg/ifglH7B0nFoa6otQFHYYgZ8UInv0kXh_TwcPCg/JEvnVrJKN7o.jpg?size=42x75&quality=95&sign=e55a55ddff2eddd17c97791db3f36090&c_uniq_tag=x0juqYipouyVQq_wrT1NY1GltRkWNkONDCa5Co4pIOw&type=album","type":"s","width":42},{"height":130,"url":"https://sun1-15.userapi.com/impg/ifglH7B0nFoa6otQFHYYgZ8UInv0kXh_TwcPCg/JEvnVrJKN7o.jpg?size=73x130&quality=95&sign=e3d55503eb26961d632b8eee5edf4f2e&c_uniq_tag=u9EM_q5N2TxLLzDlvVU7LxWLmGDfeeCbLA-hWJw5xww&type=album","type":"m","width":73},{"height":604,"url":"https://sun1-15.userapi.com/impg/ifglH7B0nFoa6otQFHYYgZ8UInv0kXh_TwcPCg/JEvnVrJKN7o.jpg?size=340x604&quality=95&sign=7b1cef1af9cf0e051cd39e6ddf9134a2&c_uniq_tag=QqBqWa0wwLB7Euz-apTnVHO2ZBURk02GYsl8i5opqqw&type=album","type":"x","width":340},{"height":807,"